('2384','18','7902','Villa Kaminski',Null,'Moderne Villa mit einem wunderbarem Meerblick in Costa den Blanes','33530','Diese  Villa befindet sich auf einem Hanggrundstück in begehrter Villenwohnlage hoch oberhalb des eleganten Yachthafens Puerto Portals und beeindruckt mit einem fantastischen Panoramablick auf die Küste und das Meer. Der Hauptwohnbereich im Erdgeschoss umfasst auf leicht versetzten Ebenen ein großes Wohnzimmer, ein Esszimmer, ein Büro, die Küche mit Wirtschaftsraum sowie einen Abstellraum und ein Gäste-WC. In der oberen Etage sind das Masterschlafzimmer mit en suite Bad, zwei weitere Schlafzimmer und ein Bad untergebracht. Darüber hinaus steht ein Gästehaus mit Wohnzimmer, Küche, zwei Schlafzimmern und einem Bad zur Verfügung. Der Außenbereich mit freien und überdachten Terrassen, Swimmingpool und Barbecue.','33531','3150000','106','2015-09-23 15:57:13','106','2015-09-23 15:57:55',Null,'2484','86','1165',1,'1','0',Null,Null,Null,'33532',Null,'0','0','0',Null,'2015-09-23 16:00:40',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33533',Null,'33534',Null,'33535',Null,'33536',Null,'33537','0',0,'4');
